INSERT INTO `wp_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(2, 53, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-10 14:31:16', '2020-08-10 14:31:16', 'Adhuc quaerendum est ne, vis ut harum tantas noluisse, id suas iisque mei. Nec te inani ponderum vulputate, facilisi expetenda has et. Iudico dictas scriptorem an vim, ei alia mentitum est, ne has voluptua praesent.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 0, 1),
(3, 53, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-10 14:31:32', '2020-08-10 14:31:32', 'Sumo euismod dissentiunt ne sit, ad eos iudico qualisque adversarium, tota falli et mei. Esse euismod urbanitas ut sed, et duo scaevola pericula splendide. Primis veritus contentiones nec ad, nec et tantas semper delicatissimi.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 0, 1),
(4, 53, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-10 14:31:51', '2020-08-10 14:31:51', 'Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 3, 1),
(5, 53, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-10 14:32:24', '2020-08-10 14:32:24', 'Investigationes demonstraverunt lectores legere me lius quod ii legunt saepius. Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 4, 1),
(6, 53, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-10 14:32:54', '2020-08-10 14:32:54', 'Typi non habent claritatem insitam; est usus legentis in iis qui facit eorum claritatem,falli et mei. Esse euismod urbanitas ut sed, et duo scaevola pericula splendide. Primis veritus contentiones nec ad, nec et tantas semper delicatissimi.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 0, 1),
(7, 53, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-10 16:46:47', '2020-08-10 16:46:47', 'Dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa. Aenean eu leo quam. Pellentesque ornare sem lacinia quam venenatis vestibulum. Nulla vitae elit libero, a pharetra augue laboris in sit minim cupidatat ut dolor voluptate enim veniam consequat occaecat fugiat in adipisicing in amet Ut nulla nisi non ut enim aliqua laborum mollit quis nostrud sed sed.\n\n', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 0, 1),
(8, 53, 'jannatul mawa', 'mawa@gmail.com', 'http://webacademybd.com/', '::1', '2020-08-10 16:57:06', '2020-08-10 16:57:06', 'Duis ex ad cupidatat tempor Excepteur cillum cupidatat fugiat nostrud cupidatat dolor sunt sint sit nisi est eu exercitation incididunt adipisicing veniam velit id fugiat enim mollit amet anim veniam dolor dolor irure velit commodo cillum sit nulla ullamco magna amet magna cupidatat qui labore cillum sit in tempor veniam consequat non laborum adipisicing aliqua ea nisi sint ut quis proident ullamco ut dolore culpa occaecat ut laboris in sit minim cupidatat ut dolor voluptate enim veniam consequat occaecat fugiat in adipisicing in amet Ut nulla nisi non ut enim aliqua laborum mollit quis nostrud sed sed.', 0, '0', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 0, 0),
(9, 58, 'nazrul rafi', 'nazrulrafi.bd@gmail.com', 'http://philosophy.nazrulrafi.com', '::1', '2020-08-11 11:29:38', '2020-08-11 11:29:38', '', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.105 Safari/537.36', '', 0, 1),
